import React from 'react'
import Navbar from 'react-bootstrap/Navbar'
export default class Logo extends React.Component {
    render() {
        return (
            <Navbar variant="dark">
                <Navbar.Brand href="/">
                    A D S O U L
                </Navbar.Brand>
            </Navbar>
        )
    }
}
